library(shiny)
library(shinydashboard)
library(shinyWidgets)
library(shinylive)
library(httpuv)

custom_css <- "
@import url('https://fonts.googleapis.com/css2?family=Archivo+Narrow:ital,wght@0,400..700;1,400..700&family=Lora:ital,wght@0,400..700;1,400..700&display=swap');

body {
  background-color: #00008B;
  font-family: 'Lora', serif;
}

h2, h3, h5 {
  color: #00008B;
  font-weight: 600;
}

h2 {
  margin-top: 0;
}

.box {
  border-radius: 10px;
  margin-bottom: 20px;
  padding: 15px;
}

.sidebar {
  color: #00008B;
}

.sidebar-menu > li > a {
  color: #FFFFFF;
}

.btn {
  background-color: #00008B;
  color: white;
  border-radius: 20px;
  margin: 5px;
}

.main-header .logo, .main-header .navbar {
  background-color: #00008B !important;
}

.main-header .navbar .sidebar-toggle {
  color: #FFFFFF !important;
}

.main-header .logo {
  font-family: 'Archivo Narrow', sans-serif !important;
  font-weight: 700;
}

img {
  display: block;
  margin-left: auto;
  margin-right: auto;
}

.headshot-container {
  padding: -10px;
  overflow: auto; /* Ensure the float does not affect the layout beyond the image container */
}

.headshot-container img {
  float: left; /* Left-justify the image */
  border-radius: 50%;
  width: 200px; /* Adjust size as desired */
  height: 200px;
  margin-right: -40px; /* Adjust margin for appropriate spacing */
}

.timeline {
  position: relative;
  max-width: 600px;
  margin: 20px auto;
  padding: 20px 0;
}

.timeline:before {
  content: '';
  position: absolute;
  width: 6px;
  background-color: #00008B;
  top: 0;
  bottom: 0;
  left: 30px;
  margin-left: -3px;
}

.timeline-event {
  padding: 20px;
  position: relative;
  background-color: inherit;
  width: 100%;
}

.timeline-event:after {
  content: '';
  display: table;
  clear: both;
}

.timeline-content {
  padding: 20px;
  background-color: white;
  position: relative;
  border-radius: 6px;
  width: 80%;
}

.timeline-content.left {
  left: 70px;
}

.timeline-content.right {
  left: 150px;
}

.timeline-point {
  width: 16px;
  height: 16px;
  background-color: #FF6F00;
  position: absolute;
  left: 22px;
  top: 20px;
  border-radius: 50%;
  z-index: 1;
}
"

ui <- dashboardPage(
  dashboardHeader(title = "VICKY Y. WANG, MHI"),
  dashboardSidebar(
    sidebarMenu(
      menuItem(" About Me", tabName = "about", icon = icon("user")),
      menuItem(" Experience", tabName = "experience", icon = icon("briefcase")),
      menuItem(" Projects", tabName = "projects", icon = icon("folder-open")),
      menuItem(" Contact", tabName = "contact", icon = icon("envelope"))
    )
  ),
  dashboardBody(
    tags$head(
      tags$style(HTML(custom_css))
    ),
    tabItems(
      # tabItem(tabName = "welcome",
                  # HTML('<iframe width="560" height="315" src="https://www.youtube.com/embed/QxlJga7Asoc?si=mIQVMhICp19Sjt4S" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" referrerpolicy="strict-origin-when-cross-origin" allowfullscreen></iframe>'),
                  # h3("Timeline of Milestones"),
                  # div(class = "timeline",
                  #     div(class = "timeline-event",
                  #         div(class = "timeline-point"),
                  #         div(class = "timeline-content left",
                  #             h4("Earlier "),
                  #             p("February 2025 - I was let go by CMS as a part of the DOGE probationary firings and am now seeking full-time employment in the DC area."),
                  #         )
                  #     ),
                  #     div(class = "timeline-event",
                  #         div(class = "timeline-point"),
                  #         div(class = "timeline-content left",
                  #             h4("Began First Full-Time Role!"),
                  #             p("January 2025 - I began working as a Management and Program Analyst at the Centers for Medicare and Medicaid Services."),
                  #         )
                  #     ),
                  #     div(class = "timeline-event",
                  #         div(class = "timeline-point"),
                  #         div(class = "timeline-content left",
                  #             h4("Completed Master of Health Informatics Degree"),
                  #             p("December 2024 - I graduated with a Master of Health Informatics from the University of Michigan."),
                  #         )
                  #     ),
                  #     div(class = "timeline-event",
                  #         div(class = "timeline-point"),
                  #         div(class = "timeline-content left",
                  #             h4("Completed Bachelor of Science Degree"),
                  #             p("May 2023 - I graduated with a BS in Microbiology from the University of Michigan.")
                  #         )
                  #     )
                  #     # Add more timeline events here as needed
                  # )
              #)
      # ),
      tabItem(tabName = "about",
              box(status = "warning", solidHeader = TRUE, width = 12,
                  h2("Hi there!"),
                  imageOutput("headshot", width = 100, height = 100),
                  br(),
                  p("My name is ", strong("Vicky Wang"), ", and I am a ", ("Business Process Analyst"), 
                    " at ", ("General Dynamics Information Technology"), " where I work as a contractor for the Centers for Medicare and Medicaid Services (CMS)."),
                  br()),
              box(status = "warning", solidHeader = TRUE, width = 12,
                  h3("About Me"),
                  h4(strong("Education")),
                  p(strong("Master of Health Informatics (MHI)")),
                  p("University of Michigan"),
                  p("08/2023 - 12/2024"),
                  br(),
                  p(strong("Bachelor of Science in Microbiology")),
                  p("Minors: Gender and Health, Applied Statistics"),
                  p("University of Michigan"), 
                  p("08/2020 - 05/2023"), br(),
                  h4(strong("Skills")),
                  p(strong("Software: "), 
                    "Microsoft Office, Microsoft Access, Google Suite"),
                  p(strong("Programming: "), 
                    "R (tidyverse, rshiny), Python (plotly, shinypy), Git/hub, C++, SQL"),
                  p(strong("Languages: "), 
                    "Mandarin, German"),
                  br(),
                  downloadButton("downloadResume",label = "Download My Resume Here"),
              )
      ),
      tabItem(tabName = "experience",
              box(status = "warning", solidHeader = TRUE, width = 12,
                  h3("Experiences"),
                  h4(strong("Professional")),
                  p(strong("Business Process Analyst")),
                  p("General Dynamics Information Technology (GDIT)"),
                  p("06/2025 - Present"),
                  p("CMS Contractor implementing the Enrollment Community, which manages parent organizations and issuers who offer QHPs in the individual Marketplace."),
                  br(),
                  p(strong("Management and Program Analyst")),
                  p("Centers for Medicare and Medicaid Services (CMS)"),
