                  p("United States Department of Agriculture National Agricultural Statistics Service (USDA NASS) | Great Lakes Region"),
                  p("05/2022 - 08/2022"),
                  p("Worked on the publication of National Agricultural Reports in the Great Lakes Region, including survey data cleaning and data visualization."),
                  br(),
                  
