                  br(),
                  h4(strong("Research")),
                  p(strong("Research Assistant")),
                  p("Institute for Social Research | Survey Research Center | Social Environment and Health Program"),
                  p("07/2024 - 12/2024, 02/2025 - Present"),
                  p("Working with Dr. Kate Duchowny on descriptive characterization of the National Neighborhood Data Archive (NaNDA)'s Essential Workers dataset. These datasets are derived from the American Community Survey and provide insights into how built environment impacts the health of its residents. My research involves understanding where essential workers live and visualizing their distribution across the United States."),
                  br(),
                  p(strong("Research Assistant")),
                  p("University of Michigan School of Public Health | Department of Health Management and Policy"),
                  p("05/2024 - 10/2024"),
                  p("Individually guided epidemiological research with Dr. Rahul Ladhania on a health application,", em("fooya!"), " geared towards children to mitigate diabetes onset using a digital health intervention."),
                  br(),
                  p(strong("Research Assistant")),
                  p("Michigan Medicine | Department of Microbiology and Immunology"),
                  p("04/2020 - 8/2023"),
                  p("Researched HIV-1 infection processes under Dr. Akira Ono, with an emphasis on molecular mechanisms impacting viral infectivity. Utilized wet laboratory and computational methods to identify proteins and genes of interest and perform analyze using live cancer cell lines."),
                  br(),
                  p(strong("Research Assistant")),
                  p("University of Michigan Department of Women and Gender Studies"),
                  p("05/2022 - 12/2022"),
                  p("Under Dr. Diana Louis, examined primary source narratives to identify mental health experiences among freed and incarcerated Black individuals in the mid to late-19th century using qualitative thematic methods."),
                  br(),
                  
                  h4(strong("Practice")),
                  p(strong("Student Consultant")),
                  p("Ginsberg Center for Community Service and Learning"),
                  p("05/2023 - 12/2024"),
                  p("Project consultant with specialization in data-based technical assistance methods."),
                  p("Notable Projects: "),
                  tags$ol(
                    tags$li("Performed ordinance analysis of Ypsilanti Twp, Pittsfield Twp, and the City of Ann Arbor regulations surrounding residential and property violations leading to fines or other punitive damages for residents using a qualitative approach."), 
                    tags$li("Developed an improved data mapping tool using RShiny and ShinyApps to support efforts to create a website application that visualizes and highlights the prevalence of manufactured housing communities in the state of Michigan. Access here: https://vwang.shinyapps.io/mhcR/"), 
                    tags$li("Explained insights into reform recommendations surrounding existing restraint laws, contributing to the establishment of the Juvenile Justice Reform Task Force, formed by Governor Whitmer and led by Lt. Governor Gilchrist to address questions relating to juvenile justice reform. Translated complex restraint and seclusion incidence data insights into actionable strategies, presenting data evaluation findings and policy recommendations to the Michigan Department of Health and Human Services in July 2023.")
                  ),
                  br(),
                  p(strong("PHAST Fellow")),
                  p("Public Health Action Support Team"),
                  p("03/2024 - 05/2024"),
                  p("In partnership with the South Central Texas Area Health Education Centers, I was deployed to San Antonio, Texas to collect data, analyze, and perform a community literacy and awareness assessment for asthma literacy in West San Antonio and presented findings to an interdisciplinary team featuring hospital administrators, community health workers and members, and state officials."),
                  br(),
              )
      ),
      tabItem(tabName = "projects",
              box(state = "warning", solidHeader = TRUE, width = 12,
                  h3("National Neighborhood Data Archive (NaNDA) Essential Workers"),
                  p(em("PROJECT IN PROGRESS.")),
                  p("I am working at the Institute for Social Research on a project to describe the neighborhoods where essential-designated occupation workers live.")
              ),
              box(status = "warning", solidHeader = TRUE, width = 12,
                  h3("Empowering Advocacy through Data: Mapping Manufactured Housing Communities with MHAction and CTAC"),
                  p(em("The Project")),
                  p("In collaboration with ", strong("MHAction"), ", Ginsberg's Community Technical Assistance Collaborative (CTAC) developed ", 
                    "an innovative web-based mapping application that visualizes ", strong("manufactured housing communities (MHCs)"), 
                    " across Michigan. The project aim was to create an accessible tool that could assist in the organization’s advocacy ", 
                    "for affordable and quality manufactured housing, and to bolster their broader campaigns for racial and economic justice."),
                  p(em("What We Created")),
                  p("Under this partnership, we designed and coded an interactive mapping web tool, accompanied by a comprehensive data use guide. ", 
                    "The tool visualizes data on MHCs, allowing users to zoom in on specific legislative districts, explore detailed community information, ",
                    "and generate site data in table form. Built on the RShiny framework, the tool integrates data sources from the ", 
                    "Michigan Department of Licensing and Regulatory Affairs (LARA) and MHVillage, ensuring data is both accurate and up-to-date. ", 
                    "The guide provides step-by-step instructions for using the tool, including data updates and running the application locally."),
                  tags$div(
                    a(href = "https://vwang.shinyapps.io/mhaction", target = "_blank", 
                      class = "btn btn-primary", "Manufactured Housing Mapping Dashboard, MHAction")
                  ),
                  br(),
                  imageOutput("mhaction_home"),
                  br()),
              box(status = "warning", solidHeader = TRUE, width = 12,                  
                  h3("Ann Arbor Summer Festival"),
                  p(em("This report outlines the processes and findings from a visitor survey conducted at the Ann Arbor Summer Festival (A2SF) in 2024. ",
                       "The survey aimed to gather demographic and experiential data from festival attendees to help A2SF better understand and serve its audience.")),
                  p(strong("Project Timeline:")),
                  p("January - April 2024: CTAC student team collaborated with A2SF to design the survey and dissemination plan for the summer season."),
                  p("June 14 - 30, 2024: In-person data collection was supported by CTAC students, except for specific dates when the festival was not operating."),
                  p("August - September 2024: Combined and analyzed in-person and postseason survey data after extensive cleaning."),
                  tags$div(
                    a(href = "https://viwack.github.io/a2sf-visitor-survey/", target = "_blank",
                      class = "btn btn-primary", "Ann Arbor Summer Festival Visitor Survey 2024 Report")
