server <- function(input, output) {
  output$headshot <- renderImage({
   list(src = "Headshot-modified.png",
        width = 100,
        height = 100)
  }, deleteFile = FALSE) 
  
  output$ctac <- renderImage({
    list(src = "ctac_logo.png")
  }, deleteFile = FALSE)
  
  output$isr <- renderImage({
    list(src = "isr.png")
  }, deleteFile = FALSE)
  
  output$nanda <- renderImage({
    list(src = "nanda_logo.png")
  }, deleteFile = FALSE)
  
  output$phast <- renderImage({
    list(src = "phast.png")
  }, deleteFile = FALSE)
  
  output$umich <- renderImage({
    list(src = "umich.png")
  }, deleteFile = FALSE)
  
  output$usda <- renderImage({
    list(src = "usda.png")
  }, deleteFile = FALSE)
  
  output$cms <- renderImage({
    list(src = "cms.png")
  }, deleteFile = FALSE)
  
  output$mhaction_home <- renderImage({
    list(src = "mhactionss.png",
         height = 300)
  }, deleteFile = FALSE)
  
  output$a2sf <- renderImage({
    list(src = "a2sf.png",
         height = 400)
  }, deleteFile = FALSE)
  
  output$downloadResume <- downloadHandler(
    filename = function() {
      paste("ResumeVickyWang", "pdf", sep = ".")
    },
    content = function(file) {
      file.copy("www/ResumeVickyWang.pdf", file)
    }
  )
}

shinyApp(ui = ui, server = server)
